SET search_path TO etl,public;


-- Get rid of old tables from previous upgrade. The order of these deletions
-- is important in order to avoid foreign key constraint violations.
DROP TABLE IF EXISTS etl.column_meta_old;
DROP TABLE IF EXISTS etl.table_state_old;
DROP TABLE IF EXISTS etl.target_table_compare_old;
DROP TABLE IF EXISTS etl.target_table_update_old;
DROP TABLE IF EXISTS etl.table_meta_old;


-- Rename the tables that will be "patched" in this script. New versions of 
-- these tables are created and patched below.
ALTER TABLE IF EXISTS etl.column_meta          RENAME TO column_meta_old;
ALTER TABLE IF EXISTS etl.table_state          RENAME TO table_state_old;
ALTER TABLE IF EXISTS etl.target_table_compare RENAME TO target_table_compare_old;
ALTER TABLE IF EXISTS etl.target_table_update  RENAME TO target_table_update_old;
ALTER TABLE IF EXISTS etl.table_meta           RENAME TO table_meta_old;


-- Rename existing constraints that apply to the tables that were just renamed
-- so that new constraints with these names can be created below for the new
-- tables created below.
ALTER TABLE IF EXISTS ONLY etl.column_meta_old          RENAME CONSTRAINT pk_etl_column_meta                                 TO pk_etl_column_meta_old;
ALTER TABLE IF EXISTS ONLY etl.table_meta_old           RENAME CONSTRAINT pk_etl_table_meta                                  TO pk_etl_table_meta_old;
ALTER TABLE IF EXISTS ONLY etl.table_state_old          RENAME CONSTRAINT pk_etl_table_state                                 TO pk_etl_table_state_old;
ALTER TABLE IF EXISTS ONLY etl.target_table_compare_old RENAME CONSTRAINT pk_etl_targettablecompare                          TO pk_etl_targettablecompare_old;
ALTER TABLE IF EXISTS ONLY etl.target_table_update_old  RENAME CONSTRAINT pk_etl_targettableupdate                           TO pk_etl_targettableupdate_old;
ALTER TABLE IF EXISTS ONLY etl.column_meta_old          RENAME CONSTRAINT uq_etl_columnmeta_tablemetaid_targetcolumnname     TO uq_etl_columnmeta_tablemetaid_targetcolumnname_old;
ALTER TABLE IF EXISTS ONLY etl.table_meta_old           RENAME CONSTRAINT uq_etl_tablemeta_targetdb_targetschema_targettable TO uq_etl_tablemeta_targetdb_targetschema_targettable_old;
ALTER TABLE IF EXISTS ONLY etl.column_meta_old          RENAME CONSTRAINT fk_columnmeta_tablemeta                            TO fk_columnmeta_tablemeta_old;
ALTER TABLE IF EXISTS ONLY etl.target_table_compare_old RENAME CONSTRAINT fk_etl_targettablecompare_tablemeta                TO fk_etl_targettablecompare_tablemeta_old;
ALTER TABLE IF EXISTS ONLY etl.target_table_update_old  RENAME CONSTRAINT fk_etl_targettableupdate_tablemeta                 TO fk_etl_targettableupdate_tablemeta_old;
ALTER TABLE IF EXISTS ONLY etl.table_state_old          RENAME CONSTRAINT fk_tablestate_tablemeta                            TO fk_tablestate_tablemeta_old;


--
-- Name: column_meta; Type: TABLE; Schema: etl; Owner: qfree_admin
--

CREATE TABLE etl.column_meta (
    column_meta_id smallint NOT NULL,
    table_meta_id smallint NOT NULL,
    source_column_name character varying(80),
    target_column_name character varying(80),
    is_primary_key_column boolean DEFAULT false NOT NULL,
    primary_key_column_order smallint,
    is_insert_id_column boolean DEFAULT false NOT NULL,
    is_inserted_on_column boolean DEFAULT false NOT NULL,
    is_last_updated_on_column boolean DEFAULT false NOT NULL,
    is_row_can_be_deleted_from_column boolean DEFAULT false NOT NULL,
    is_can_delete_row_column boolean DEFAULT false NOT NULL,
    is_updatable_column boolean DEFAULT false NOT NULL,
    mirror_column boolean DEFAULT false NOT NULL,
    compare_column boolean DEFAULT false NOT NULL
);


--
-- Name: table_meta; Type: TABLE; Schema: etl; Owner: qfree_admin
--

CREATE TABLE etl.table_meta (
    table_meta_id smallint NOT NULL,
    source_db_id smallint NOT NULL,
    source_schema_name character varying(80) NOT NULL,
    source_table_name character varying(80) NOT NULL,
    target_db_id smallint NOT NULL,
    target_schema_name character varying(80) NOT NULL,
    target_table_name character varying(80) NOT NULL,
    can_insert_rows boolean DEFAULT true NOT NULL,
    can_update_rows boolean DEFAULT false NOT NULL,
    can_delete_rows boolean DEFAULT false NOT NULL,
    is_static_support_table boolean DEFAULT false NOT NULL,
    row_can_be_deleted_from_seconds integer,
    can_delete_row_schema_name character varying(80),
    can_delete_row_table_name character varying(80),
    delete_marked_rows_table_order smallint,
    mark_rows_for_deletion_algorithm_id smallint DEFAULT 0 NOT NULL,
    delete_marked_rows_algorithm_id smallint DEFAULT 0 NOT NULL,
    update_target_table_algorithm_id smallint DEFAULT 0 NOT NULL,
    update_target_table boolean DEFAULT false NOT NULL,
    mark_rows_for_deletion boolean DEFAULT false NOT NULL,
    delete_marked_rows boolean DEFAULT false NOT NULL,
    compare_target_table boolean DEFAULT false NOT NULL,
    source_db_etl_state_register_schema_name character varying(80),
    source_db_etl_state_register_table_name character varying(80),
    CONSTRAINT row_can_be_deleted_from_seconds_positive CHECK ((row_can_be_deleted_from_seconds >= 0))
);


--
-- Name: table_state; Type: TABLE; Schema: etl; Owner: qfree_admin
--

CREATE TABLE etl.table_state (
    table_state_id smallint NOT NULL,
    target_last_updated_on timestamp without time zone,
    target_last_updated_algorithm_id smallint,
    target_last_updated_elapsed_time_millis integer,
    target_last_updated_num_inserts integer,
    target_last_updated_num_updates integer,
    target_last_updated_num_rows_processed integer,
    target_last_updated_num_rows_processed_per_sec real,
    target_last_updated_insert_id_colname character varying(80),
    target_last_updated_insert_id_maxvalue bigint,
    target_last_updated_last_updated_on_colname character varying(80),
    target_last_updated_last_updated_on_maxvalue timestamp without time zone,
    last_compared_on timestamp without time zone,
    last_compared_num_rows_equal integer,
    last_compared_num_rows_unequal integer,
    last_compared_num_rows_missing_from_target integer,
    last_compared_num_rows_extra_in_target integer,
    max_insert_id bigint
);


